import AllList from "./Components/AllList";
import MyList from "./Components/MyList";
import {useState} from 'react';
import './App.css';



function App() {
  const [myList , setmyList]= useState([]);

  function updateList(school){
    if(myList.indexOf(school) === -1)
      setmyList([...myList,school]);
  }
  function myClick(){
    return(
      <div><MyList mL={myList}/></div>
    )
  }



  function AllClick(){
    return(
      <div><AllList update={updateList}/></div>
    )
  }


  return (
    <div className="APP">
      <div className="navbar">
            <button onClick={myClick}>My List</button>
            <button onClick={AllClick}>University List </button>
        </div>
        <AllList update={updateList}/>
    </div>
  )
}

export default App;
